import Main from './components/Main'
import Paragraph from './components/Paragraph'



const Live = () => {
  return (
    < Main>
      <h1 className='header'> Upcoming Live</h1>
      <Paragraph>
        Live at my house every day
      </Paragraph>
    </Main>
  );
};

export default Live;
